import React, { useEffect, useState } from 'react';
import classes from './Main.module.css';
import Header from 'components/Header/Header';
import Button from '../../components/UI/Button/Button';
import DinamicCounter from '../../components/DinamicCounter/DinamicCounter';

export default function Main() {
  useEffect(() => {
    document.title = 'Avant-Техно | Главная';
  });
  const [state, setState] = useState(0);
  return (
    <main className={classes.main__container}>
        <Header/>
        <div>
          <h3>Главная страница</h3>
          <Button text= {"+"} onClick={() => {setState(state+1)}}/>
          <h1>{state}</h1>
          <Button text={"-"} onClick={() => {setState(state-1)}}/>
        </div>
        <DinamicCounter number={555}/>
    </main>
  );
}
